// src/App.js

import React from 'react';
import MapView from './components/MapView';
import './App.css';

function App() {
  return (
    <div className="flex flex-col h-screen">
      <nav className="bg-blue-600 p-4 shadow-md">
        <div className="container mx-auto flex items-center justify-between">
          <h1 className="text-white text-2xl font-bold">GeoViz Explorer</h1>
          <div className="flex space-x-4">
            <a href="#home" className="text-white hover:text-blue-200">
              Home
            </a>
            <a href="#about" className="text-white hover:text-blue-200">
              About
            </a>
            <a href="#contact" className="text-white hover:text-blue-200">
              Contact
            </a>
          </div>
        </div>
      </nav>
      <div className="flex-1">
        <MapView />
      </div>
    </div>
  );
}

export default App;
